const K=[{id:"1771303350589",parentId:"root",type:"location",x:71.84155110222083,y:63.26919484999195,title:"Mercury",content:'<p><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">The&nbsp;smallest&nbsp;planet&nbsp;and&nbsp;the&nbsp;closest&nbsp;to&nbsp;the&nbsp;Sun.&nbsp;It&nbsp;has&nbsp;a&nbsp;rocky&nbsp;surface&nbsp;covered&nbsp;in&nbsp;craters,&nbsp;resembling&nbsp;Earth&#39;s&nbsp;Moon.</span></p><ul><li><strong style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">Fun&nbsp;Fact:</strong><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">&nbsp;Despite&nbsp;being&nbsp;closest&nbsp;to&nbsp;the&nbsp;Sun,&nbsp;it&nbsp;isn&#39;t&nbsp;the&nbsp;hottest&nbsp;planet&nbsp;(Venus&nbsp;takes&nbsp;that&nbsp;title)&nbsp;because&nbsp;it&nbsp;has&nbsp;virtually&nbsp;no&nbsp;atmosphere&nbsp;to&nbsp;trap&nbsp;heat.</span></li><li><strong style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">Fun&nbsp;Fact:</strong><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">&nbsp;A&nbsp;year&nbsp;on&nbsp;Mercury&nbsp;is&nbsp;just&nbsp;88&nbsp;Earth&nbsp;days,&nbsp;but&nbsp;a&nbsp;single&nbsp;&quot;day&quot;&nbsp;(sunrise&nbsp;to&nbsp;sunrise)&nbsp;takes&nbsp;176&nbsp;Earth&nbsp;days.</span></li></ul>',mapImage:null,icon:"planet",showLabel:!1,color:"#ffffff",size:"small"},{id:"1771303847772",parentId:"root",type:"location",x:79.19156412021132,y:58.75797290728988,title:"Venus",content:'<p><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">Often&nbsp;called&nbsp;Earth&#39;s&nbsp;&quot;sister&nbsp;planet&quot;&nbsp;due&nbsp;to&nbsp;similar&nbsp;size&nbsp;and&nbsp;structure,&nbsp;Venus&nbsp;is&nbsp;shrouded&nbsp;in&nbsp;thick,&nbsp;toxic&nbsp;clouds&nbsp;of&nbsp;sulfuric&nbsp;acid&nbsp;that&nbsp;trap&nbsp;immense&nbsp;heat.</span></p><ul><li><strong style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">Fun&nbsp;Fact:</strong><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">&nbsp;Venus&nbsp;spins&nbsp;backward&nbsp;(retrograde&nbsp;rotation)&nbsp;compared&nbsp;to&nbsp;most&nbsp;other&nbsp;planets,&nbsp;meaning&nbsp;the&nbsp;Sun&nbsp;rises&nbsp;in&nbsp;the&nbsp;west&nbsp;and&nbsp;sets&nbsp;in&nbsp;the&nbsp;east.</span></li><li><strong style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">Fun&nbsp;Fact:</strong><span style="background-color: rgb(19, 19, 20); color: rgb(227, 227, 227);">&nbsp;Its&nbsp;day&nbsp;is&nbsp;longer&nbsp;than&nbsp;its&nbsp;year;&nbsp;it&nbsp;takes&nbsp;243&nbsp;Earth&nbsp;days&nbsp;to&nbsp;rotate&nbsp;once&nbsp;but&nbsp;only&nbsp;225&nbsp;days&nbsp;to&nbsp;orbit&nbsp;the&nbsp;Sun.</span></li></ul><p></p>',mapImage:null,icon:"planet",showLabel:!1,color:"#f97316",size:"medium"},{id:"1771303903364",parentId:"root",type:"location",x:85.79505197067716,y:52.75050380554413,title:"Earth",content:'<p><span style="color: rgb(227, 227, 227); background-color: rgb(19, 19, 20);">Our&nbsp;home&nbsp;is&nbsp;the&nbsp;only&nbsp;known&nbsp;planet&nbsp;to&nbsp;support&nbsp;life,&nbsp;with&nbsp;a&nbsp;surface&nbsp;that&nbsp;is&nbsp;70%&nbsp;liquid&nbsp;water.</span></p><ul><li><strong style="color: rgb(227, 227, 227); background-color: rgb(19, 19, 20);">Fun&nbsp;Fact:</strong><span style="color: rgb(227, 227, 227); background-color: rgb(19, 19, 20);">&nbsp;Earth&nbsp;is&nbsp;not&nbsp;a&nbsp;perfect&nbsp;sphere;&nbsp;it&#39;s&nbsp;an&nbsp;&quot;oblate&nbsp;spheroid,&quot;&nbsp;meaning&nbsp;it&nbsp;bulges&nbsp;slightly&nbsp;at&nbsp;the&nbsp;equator&nbsp;due&nbsp;to&nbsp;its&nbsp;rotation.</span></li><li><strong style="color: rgb(227, 227, 227); background-color: rgb(19, 19, 20);">Fun&nbsp;Fact:</strong><span style="color: rgb(227, 227, 227); background-color: rgb(19, 19, 20);">&nbsp;The&nbsp;planet&#39;s&nbsp;magnetic&nbsp;field&nbsp;acts&nbsp;as&nbsp;a&nbsp;shield,&nbsp;protecting&nbsp;us&nbsp;from&nbsp;harmful&nbsp;solar&nbsp;radiation&nbsp;and&nbsp;creating&nbsp;the&nbsp;auroras&nbsp;(Northern&nbsp;and&nbsp;Southern&nbsp;Lights).</span></li></ul>',mapImage:"data:image/jpeg;base64,",icon:"planet",showLabel:!1,color:"#3b82f6",size:"medium",connections:[],starSettings:{starColor:"#ffffff",bgColor:"transparent",speed:0,twinkleSpeed:.8,nebulaColor:"#002aff",nebulaIntensity:.7}},{id:"1771303952996",parentId:"root",type:"location",x:88.63229909577949,y:50.87785865328376,title:"Luna",content:"<p><strong>Earth&#39;s&nbsp;Moon</strong>&nbsp;The&nbsp;fifth-largest&nbsp;moon&nbsp;in&nbsp;the&nbsp;solar&nbsp;system&nbsp;and&nbsp;the&nbsp;only&nbsp;place&nbsp;beyond&nbsp;Earth&nbsp;where&nbsp;humans&nbsp;have&nbsp;set&nbsp;foot.&nbsp;It&nbsp;is&nbsp;a&nbsp;dusty,&nbsp;rocky&nbsp;world&nbsp;with&nbsp;no&nbsp;atmosphere&nbsp;to&nbsp;speak&nbsp;of.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;We&nbsp;always&nbsp;see&nbsp;the&nbsp;same&nbsp;face&nbsp;of&nbsp;the&nbsp;Moon&nbsp;because&nbsp;it&nbsp;is&nbsp;&quot;tidally&nbsp;locked&quot;&nbsp;to&nbsp;Earth,&nbsp;meaning&nbsp;it&nbsp;rotates&nbsp;on&nbsp;its&nbsp;axis&nbsp;at&nbsp;the&nbsp;exact&nbsp;same&nbsp;speed&nbsp;it&nbsp;orbits&nbsp;our&nbsp;planet.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;You&nbsp;would&nbsp;weigh&nbsp;much&nbsp;less&nbsp;on&nbsp;the&nbsp;Moonabout&nbsp;16.5%&nbsp;of&nbsp;your&nbsp;weight&nbsp;on&nbsp;Earthso&nbsp;if&nbsp;you&nbsp;weigh&nbsp;150&nbsp;lbs&nbsp;here,&nbsp;youd&nbsp;weigh&nbsp;only&nbsp;about&nbsp;25&nbsp;lbs&nbsp;there.</li></ul>",mapImage:null,icon:"planet",showLabel:!1,color:"#64748b",size:"tiny",connections:["1771303903364"]},{id:"1771304092716",parentId:"root",type:"location",x:93.1290249253872,y:44.038413614448594,title:"Mars",content:"<p>Known&nbsp;as&nbsp;the&nbsp;&quot;Red&nbsp;Planet&quot;&nbsp;due&nbsp;to&nbsp;iron&nbsp;oxide&nbsp;(rust)&nbsp;in&nbsp;its&nbsp;soil.&nbsp;It&nbsp;is&nbsp;a&nbsp;dusty,&nbsp;cold&nbsp;desert&nbsp;world&nbsp;with&nbsp;a&nbsp;very&nbsp;thin&nbsp;atmosphere.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Mars&nbsp;is&nbsp;home&nbsp;to&nbsp;<strong>Olympus&nbsp;Mons</strong>,&nbsp;the&nbsp;largest&nbsp;volcano&nbsp;in&nbsp;the&nbsp;solar&nbsp;system,&nbsp;which&nbsp;stands&nbsp;about&nbsp;three&nbsp;times&nbsp;taller&nbsp;than&nbsp;Mount&nbsp;Everest.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;It&nbsp;has&nbsp;a&nbsp;canyon&nbsp;system&nbsp;called&nbsp;Valles&nbsp;Marineris&nbsp;that&nbsp;is&nbsp;10&nbsp;times&nbsp;longer&nbsp;and&nbsp;3&nbsp;times&nbsp;deeper&nbsp;than&nbsp;the&nbsp;Grand&nbsp;Canyon.</li></ul><p></p>",mapImage:null,icon:"planet",showLabel:!1,color:"#ef4444",size:"medium"},{id:"1771304124052",parentId:"root",type:"location",x:17.802770873413813,y:77.7611869809477,title:"The Asteroid Belt",content:"",mapImage:null,icon:"danger",showLabel:!1,color:"#64748b",size:"extraLarge"},{id:"1771304148588",parentId:"root",type:"location",x:12.654516910962746,y:46.210172707780494,title:"The Visitor",content:"<p><strong>Halley&#39;s&nbsp;Comet</strong>&nbsp;The&nbsp;most&nbsp;famous&nbsp;&quot;periodic&quot;&nbsp;comet,&nbsp;visible&nbsp;from&nbsp;Earth&nbsp;every&nbsp;7576&nbsp;years.&nbsp;It&nbsp;is&nbsp;a&nbsp;&quot;dirty&nbsp;snowball&quot;&nbsp;made&nbsp;of&nbsp;ice,&nbsp;rock,&nbsp;and&nbsp;dust&nbsp;that&nbsp;leaves&nbsp;a&nbsp;tail&nbsp;of&nbsp;gas&nbsp;and&nbsp;particles&nbsp;as&nbsp;it&nbsp;nears&nbsp;the&nbsp;Sun.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;It&nbsp;is&nbsp;the&nbsp;only&nbsp;known&nbsp;short-period&nbsp;comet&nbsp;that&nbsp;is&nbsp;regularly&nbsp;visible&nbsp;to&nbsp;the&nbsp;naked&nbsp;eye&nbsp;and&nbsp;can&nbsp;appear&nbsp;twice&nbsp;in&nbsp;a&nbsp;human&nbsp;lifetime.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;The&nbsp;last&nbsp;time&nbsp;it&nbsp;was&nbsp;here&nbsp;was&nbsp;1986,&nbsp;and&nbsp;it&nbsp;is&nbsp;projected&nbsp;to&nbsp;return&nbsp;in&nbsp;mid-2061.</li></ul>",mapImage:null,icon:"exotic",showLabel:!1,color:"#3b82f6",size:"tiny"},{id:"1771304207908",parentId:"root",type:"location",x:36.44621785847119,y:22.357201819716742,title:"Jupiter",content:"<p>The&nbsp;largest&nbsp;planet&nbsp;in&nbsp;our&nbsp;solar&nbsp;system,&nbsp;a&nbsp;gas&nbsp;giant&nbsp;more&nbsp;than&nbsp;twice&nbsp;as&nbsp;massive&nbsp;as&nbsp;all&nbsp;the&nbsp;other&nbsp;planets&nbsp;combined.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;The&nbsp;<strong>Great&nbsp;Red&nbsp;Spot</strong>&nbsp;is&nbsp;a&nbsp;gigantic&nbsp;storm&nbsp;that&nbsp;has&nbsp;been&nbsp;raging&nbsp;for&nbsp;hundreds&nbsp;of&nbsp;years&nbsp;and&nbsp;is&nbsp;wider&nbsp;than&nbsp;Earth.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Jupiter&nbsp;has&nbsp;a&nbsp;faint&nbsp;ring&nbsp;system&nbsp;and&nbsp;95&nbsp;known&nbsp;moons&nbsp;(as&nbsp;of&nbsp;recent&nbsp;counts),&nbsp;including&nbsp;Ganymede,&nbsp;the&nbsp;largest&nbsp;moon&nbsp;in&nbsp;the&nbsp;solar&nbsp;system.</li></ul>",mapImage:null,icon:"planet",showLabel:!1,color:"#f97316",size:"extraLarge"},{id:"1771304468931",parentId:"1771303903364",type:"location",x:65.8539709501888,y:34.62734485635027,title:"Michigan",content:"<p>Home&nbsp;to&nbsp;the&nbsp;Statue&nbsp;of&nbsp;Liberty&nbsp;as&nbsp;everyone&nbsp;knows.</p>",mapImage:null,icon:"building",showLabel:!1,color:"#ef4444",size:"medium"},{id:"1771304505835",parentId:"1771303903364",type:"location",x:60.23478159350552,y:42.175890394693994,title:"Illinois",content:"<p>Home&nbsp;to&nbsp;the&nbsp;Other&nbsp;Statue&nbsp;of&nbsp;Liberty</p>",mapImage:null,icon:"building",showLabel:!1,color:"#ef4444",size:"medium"},{id:"1771304684531",parentId:"root",type:"location",x:27.89219397552402,y:16.37383730692222,title:"Saturn",content:"<p>Famous&nbsp;for&nbsp;its&nbsp;spectacular,&nbsp;complex&nbsp;ring&nbsp;system&nbsp;made&nbsp;of&nbsp;ice,&nbsp;rock,&nbsp;and&nbsp;dust.&nbsp;Like&nbsp;Jupiter,&nbsp;it&nbsp;is&nbsp;a&nbsp;massive&nbsp;gas&nbsp;giant&nbsp;dominated&nbsp;by&nbsp;hydrogen&nbsp;and&nbsp;helium.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Saturn&nbsp;is&nbsp;the&nbsp;least&nbsp;dense&nbsp;planet&nbsp;in&nbsp;the&nbsp;solar&nbsp;system;&nbsp;if&nbsp;you&nbsp;could&nbsp;build&nbsp;a&nbsp;bathtub&nbsp;big&nbsp;enough,&nbsp;Saturn&nbsp;would&nbsp;float&nbsp;in&nbsp;water.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Its&nbsp;winds&nbsp;can&nbsp;reach&nbsp;speeds&nbsp;of&nbsp;1,100&nbsp;mph&nbsp;(1,800&nbsp;km/h),&nbsp;far&nbsp;faster&nbsp;than&nbsp;Jupiter&#39;s&nbsp;winds.</li></ul><p></p>",mapImage:null,icon:"planet",showLabel:!1,color:"#eab308",size:"large"},{id:"1771304722827",parentId:"root",type:"location",x:21.229219340218545,y:13.64360779303051,title:"Uranus",content:"<p>An&nbsp;&quot;ice&nbsp;giant&quot;&nbsp;with&nbsp;a&nbsp;pale&nbsp;blue-green&nbsp;color&nbsp;caused&nbsp;by&nbsp;methane&nbsp;in&nbsp;its&nbsp;atmosphere.&nbsp;It&nbsp;is&nbsp;the&nbsp;coldest&nbsp;planetary&nbsp;atmosphere&nbsp;in&nbsp;the&nbsp;solar&nbsp;system.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Uranus&nbsp;is&nbsp;unique&nbsp;because&nbsp;it&nbsp;rotates&nbsp;on&nbsp;its&nbsp;side,&nbsp;rolling&nbsp;like&nbsp;a&nbsp;ball&nbsp;around&nbsp;the&nbsp;Sun&nbsp;rather&nbsp;than&nbsp;spinning&nbsp;like&nbsp;a&nbsp;top.&nbsp;This&nbsp;causes&nbsp;extreme&nbsp;seasonal&nbsp;changes&nbsp;that&nbsp;last&nbsp;for&nbsp;decades.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;It&nbsp;was&nbsp;the&nbsp;first&nbsp;planet&nbsp;discovered&nbsp;with&nbsp;the&nbsp;aid&nbsp;of&nbsp;a&nbsp;telescope&nbsp;(in&nbsp;1781&nbsp;by&nbsp;William&nbsp;Herschel).</li></ul><p></p>",mapImage:null,icon:"planet",showLabel:!1,color:"#06b6d4",size:"large"},{id:"1771304746154",parentId:"root",type:"location",x:15.610013301094044,y:11.806751387468955,title:"Neptune",content:"<p>The&nbsp;most&nbsp;distant&nbsp;major&nbsp;planet,&nbsp;dark,&nbsp;cold,&nbsp;and&nbsp;whipped&nbsp;by&nbsp;supersonic&nbsp;winds.&nbsp;It&nbsp;is&nbsp;an&nbsp;ice&nbsp;giant&nbsp;similar&nbsp;to&nbsp;Uranus&nbsp;but&nbsp;a&nbsp;deeper&nbsp;blue.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Neptune&nbsp;has&nbsp;the&nbsp;strongest&nbsp;winds&nbsp;in&nbsp;the&nbsp;solar&nbsp;system,&nbsp;reaching&nbsp;speeds&nbsp;of&nbsp;1,200&nbsp;mph&nbsp;(2,000&nbsp;km/h).</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Because&nbsp;it&nbsp;is&nbsp;so&nbsp;far&nbsp;away,&nbsp;one&nbsp;year&nbsp;on&nbsp;Neptune&nbsp;lasts&nbsp;nearly&nbsp;165&nbsp;Earth&nbsp;years.&nbsp;It&nbsp;completed&nbsp;its&nbsp;first&nbsp;full&nbsp;orbit&nbsp;since&nbsp;its&nbsp;discovery&nbsp;(in&nbsp;1846)&nbsp;only&nbsp;recently&nbsp;in&nbsp;2011.</li></ul>",mapImage:null,icon:"planet",showLabel:!1,color:"#3b82f6",size:"medium"},{id:"1771304784042",parentId:"root",type:"location",x:2.2962903755518465,y:11.059491610166502,title:"Pluto",content:"<p>Once&nbsp;considered&nbsp;the&nbsp;ninth&nbsp;planet,&nbsp;Pluto&nbsp;is&nbsp;now&nbsp;the&nbsp;most&nbsp;famous&nbsp;resident&nbsp;of&nbsp;the&nbsp;Kuiper&nbsp;Belt,&nbsp;a&nbsp;ring&nbsp;of&nbsp;icy&nbsp;bodies&nbsp;beyond&nbsp;Neptune.&nbsp;It&nbsp;is&nbsp;actually&nbsp;smaller&nbsp;than&nbsp;Earth&#39;s&nbsp;Moon.</p><ul><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Pluto&nbsp;has&nbsp;a&nbsp;giant,&nbsp;heart-shaped&nbsp;glacier&nbsp;on&nbsp;its&nbsp;surface&nbsp;made&nbsp;of&nbsp;nitrogen&nbsp;ice,&nbsp;known&nbsp;as&nbsp;<strong>Tombaugh&nbsp;Regio</strong>.</li><li><strong>Fun&nbsp;Fact:</strong>&nbsp;Its&nbsp;orbit&nbsp;is&nbsp;so&nbsp;oval-shaped&nbsp;(elliptical)&nbsp;that&nbsp;for&nbsp;about&nbsp;20&nbsp;years&nbsp;of&nbsp;its&nbsp;248-year&nbsp;trip&nbsp;around&nbsp;the&nbsp;Sun,&nbsp;it&nbsp;comes&nbsp;closer&nbsp;to&nbsp;us&nbsp;than&nbsp;Neptune&nbsp;does.</li></ul><p></p>",mapImage:null,icon:"planet",showLabel:!1,color:"#64748b",size:"tiny"},{id:"1771304879738",parentId:"1771303903364",type:"location",x:63.199291922495426,y:29.16582269712172,title:"Traverse City",content:"<p>A&nbsp;fun&nbsp;little&nbsp;town,&nbsp;with&nbsp;a&nbsp;lot&nbsp;of&nbsp;cherries.</p>",mapImage:"data:image/jpeg;base64,",icon:"default",showLabel:!1,color:"#ef4444",size:"medium",starSettings:{starColor:"#ffffff",bgColor:"transparent",speed:0,twinkleSpeed:.8,nebulaColor:"#ff0000",nebulaIntensity:1}},{id:"1771304970290",parentId:"1771304879738",type:"location",x:29.53020148976378,y:66.10631794298662,title:"Sleeping Bear Dunes",content:"<p>Legend&nbsp;has&nbsp;it,&nbsp;Jake&nbsp;is&nbsp;still&nbsp;here&nbsp;on&nbsp;one&nbsp;knee.</p>",mapImage:null,icon:"danger",showLabel:!1,color:"#ef4444",size:"large"}],U="data:image/jpeg;base64,",F=!0,A={items:K,rootMapImage:U,isDarkMode:F};export{A as default,F as isDarkMode,K as items,U as rootMapImage};
